description:
Marisa Lee Miller is an American model best known for her appearances in the Sports Illustrated Swimsuit Issues and her work for lingerie retailer Victoria's Secret.

Her accomplishments have led to her being dubbed the &quot;return of the great American supermodel.&quot;

Miller is considered a sex symbol; she ranked #1 on Maxim magazine's 2008 &quot;Hot 100&quot; list and in FHM's global 2010 &quot;Sexiest Women in the World&quot; poll.

She is also known for contracts with companies like Harley-Davidson, for whom she is the first spokesperson in the history of the company.


